import * as React from 'react';
import {Container, Typography} from '@mui/material';
import { makeStyles } from '@mui/styles';
import { Grid } from '@mui/material';
import { Box } from '@mui/material';
import { styled } from '@mui/material/styles';
import Button from '@mui/material/Button';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import { CardActionArea } from '@mui/material';
import {TextField, CardHeader, Tab, Tabs} from '@mui/material/';
import {Table,TableBody,TableCell,TableContainer,TableHead,TableRow,Paper,IconButton,Select,MenuItem} from '@mui/material/';
import DeleteIcon from '@mui/icons-material/Delete';
import {PropTypes} from 'prop-types'
import { Link } from 'react-router-dom';
import {Avatar} from '@mui/material';
import TableFooter from '@mui/material/TableFooter';
import TablePagination from '@mui/material/TablePagination';
import SearchIcon from '@mui/icons-material/Search';
import InputAdornment from '@mui/material/InputAdornment';


// Data 

const useStyles = makeStyles((theme) => ({
    table:{
        minWidth: 650,
    },
    Container: {
        marginTop: 50,
        maxWidth: 1000,
    },
    page:{
        alignContent:'right'
    }
}));

let suggestion = ['Needs Watering', 'Needs Sunlight', 'Needs Fertilising'];
let reason = ['Due to yellow leaves', 'Due to repotting'];
let status = ['Done'];
let statusdate = ['25.05.2019']
let date = 'May 28, 2021';
let priority = ['HIGH', 'LOW', 'MEDIUM'];
let plantName=['Salad Leaves', 'Salad Leaves' , 'Salad Leaves', 'Salad Leaves', 'Salad Leaves', 'Salad Leaves',
'Salad Leaves', 'Salad Leaves', 'Salad Leaves', 'Salad Leaves'];
let Plants = [];

for (let i = 0; i < plantName.length; i++) {
    Plants[i] = {
        Suggestion: suggestion[Math.floor(Math.random()* suggestion.length)],
        Reason: reason[Math.floor(Math.random()* reason.length)],
        Status : status,
        StatusDate : statusdate,
        Date : date,
        Priority: priority[Math.floor(Math.random()* priority.length)],
        PlantName : plantName[i]
    }
};

const Input = styled('input')({
    display: 'none',
  });

function Individual() {
    const classes = useStyles();
    const [page, setPage] = React.useState(0);
    const [rowsPerPage, setRowsPerPage] = React.useState(5);

    const handleChangePage = (event, newPage) => {
        setPage(newPage);
    };

    const handleChangeRowsPerPage = (event) => {
        setRowsPerPage(+event.target.value);
        setPage(0);
    };
    return (
        <Container className={classes.Container}>
            <Box sx={{ flexGrow: 1 }}>
                <Grid container spacing={2}>
                    <Grid item xs={10}>
                        <Typography variant="h5" fontWeight = "bold">Salad Leaves</Typography>
                    </Grid>
                    <Grid item xs={2}>
                    <label htmlFor="contained-button-file">
                        <Input accept="image/*" id="contained-button-file" multiple type="file" />
                        <Button variant="contained" component="span">
                          + Upload
                        </Button>
                    </label>
                    </Grid>
                </Grid>
                <Grid container spacing={2} style={{marginTop: "2rem", padding: "20px"}}>
                    <Card sx={{ maxWidth: 400 }} style={{marginRight: "1.5rem"}}>
                        <CardActionArea>
                            <CardMedia
                              component="img"
                              height="140"
                              image="./images/houseplant.jpg"
                              alt="salad leaves"
                            />
                            <CardContent>
                                <Typography gutterBottom variant="h8" component="div">
                                  Date: 05-05-2021
                                </Typography>
                            </CardContent>
                      </CardActionArea>
                    </Card>
                    <Card sx={{ maxWidth: 400 }}>
                        <CardActionArea>
                            <CardMedia
                              component="img"
                              height="140"
                              image="./images/houseplant.jpg"
                              alt="salad leaves"
                            />
                            <CardContent>
                                <Typography gutterBottom variant="h8" component="div">
                                  Date: 15-04-2021
                                </Typography>
                            </CardContent>
                      </CardActionArea>
                    </Card>
                </Grid>
            </Box>

            <Grid container spacing={2}>
              <Grid item xs={6} md={8}>
                <Typography variant="h5" fontWeight = "bold">Notifications</Typography>
              </Grid>
              <Grid item xs={6} md={4}>
                <TextField label="Search for notification"
                  InputProps={{
                  startAdornment: (
                  <InputAdornment position="start">
                    <IconButton>
                      <SearchIcon/>
                    </IconButton>
                  </InputAdornment>
                  )
                }}
                />
              </Grid>
            </Grid>
            <TableContainer component={Paper} style={{marginTop: "20rem"}}>
              <Table aria-label="notifications">
                <TableHead>
                  <TableRow>
                    <TableCell data-testid={"suggestionCell"}>Suggestion</TableCell>
                    <TableCell data-testid={"status2Cell"}>Status</TableCell>
                    <TableCell data-testid={"date2Cell"}>Date</TableCell>
                    <TableCell data-testid={"priority2Cell"}>Priority</TableCell>
                    <TableCell data-testid={"plantNameCell"}>Name</TableCell>
                  </TableRow>
                </TableHead>
                  <TableBody>
                    {Plants.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage).map((row) => (
                    <TableRow
                      key={row.name}
                    >
                      <TableCell >
                          <Typography fontWeight = 'bold' color = '#2a2a2c'>
                              {row.Suggestion}
                          </Typography>
                          <Typography color ='textSecondary' variant = 'body2' >{row.Reason} </Typography>
                      </TableCell>
                      <TableCell >
                          <Typography fontWeight = 'bold' color = '#2a2a2c'>
                              {row.Status}
                          </Typography>
                          <Typography color ='textSecondary' variant = 'body2' >{'on 24.05.2019'} </Typography>
                      </TableCell>
                      <TableCell >
                          <Typography fontWeight = 'bold' color = '#2a2a2c'>
                              {row.Date}
                          </Typography>
                          <Typography color ='textSecondary' variant = 'body2'>{'5.00 PM'} </Typography>
                      </TableCell>
                      <TableCell >
                          <Typography
                            className={classes.priority}
                            style={{
                                backgroundColor:
                                ((row.Priority === 'HIGH' && 'red') ||
                                (row.Priority === 'MEDIUM' && 'orange') ||
                                (row.Priority === 'LOW' && 'green'))
                            }}
                            >{row.Priority}
                          </Typography>
                      </TableCell>
                      <TableCell >
                        <Grid container>
                        <Grid item lg = {10}>
                            <Typography fontWeight = 'bold' color = '#2a2a2c'>{row.PlantName} </Typography>
                        </Grid>
                        </Grid>
                      </TableCell>
                    </TableRow>
                  ))}
                  </TableBody>
                  <TableFooter>
                  <TablePagination
                      rowsPerPageOptions={[5, 10, 15]}
                      component="div"
                      count={Plants.length}
                      rowsPerPage={rowsPerPage}
                      page={page}
                      onPageChange={handleChangePage}
                      onRowsPerPageChange={handleChangeRowsPerPage}/>
                  </TableFooter>
              </Table>
            </TableContainer>
            <br/>

        </Container>
    );
}


export default Individual;
